import React, { useState, useEffect } from 'react';
import { getUsers, deleteUser } from '../services/userService';
import UserForm from '../components/UserForm';
import './Users.css';

const Users = () => {
  const [users, setUsers] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [showDetails, setShowDetails] = useState(false); // State for modal visibility

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await getUsers();
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
    }
  };

  const handleDelete = async (id) => {
    try {
      await deleteUser(id);
      fetchUsers();
    } catch (error) {
      console.error('Error deleting user:', error);
    }
  };

  const handleView = (user) => {
    setSelectedUser(user);
    setShowDetails(true); // Show modal
  };

  return (
    <div className="user-page-container">
      <h1 className="page-title">Users</h1>
      <button
        className="btn btn-success mb-3"
        onClick={() => setShowForm(true)}
      >
        Add User
      </button>
      <ul className="user-list">
        {users.length > 0 ? (
          users.map((user) => (
            <li className="user-list-item" key={user.id}>
              {user.firstName} {user.lastName}
              <div className="btn-group">
                <button
                  className="btn btn-info"
                  onClick={() => handleView(user)}
                >
                  View
                </button>
                <button
                  className="btn btn-danger"
                  onClick={() => handleDelete(user.id)}
                >
                  Delete
                </button>
              </div>
            </li>
          ))
        ) : (
          <p>No users available.</p>
        )}
      </ul>

      {/* Modal for Viewing User Details */}
      {showDetails && selectedUser && (
        <div className="modal show d-block" tabIndex="-1">
          <div className="modal-dialog">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">User Details</h5>
                <button
                  type="button"
                  className="btn-close"
                  onClick={() => setShowDetails(false)}
                ></button>
              </div>
              <div className="modal-body">
                <p><strong>First Name:</strong> {selectedUser.firstName}</p>
                <p><strong>Last Name:</strong> {selectedUser.lastName}</p>
                <p><strong>Date of Birth:</strong> {selectedUser.dateOfBirth}</p>
                <p><strong>Gender:</strong> {selectedUser.gender}</p>
                <h6>Identification</h6>
                <p><strong>Number:</strong> {selectedUser.identification?.number}</p>
                <p><strong>Type:</strong> {selectedUser.identification?.type}</p>
                <p><strong>Expiration:</strong> {selectedUser.identification?.expiration}</p>
                <p><strong>Country:</strong> {selectedUser.identification?.country}</p>
                <h6>Vehicle</h6>
                {selectedUser.vehicle ? (
                  <>
                    <p><strong>Plate Number:</strong> {selectedUser.vehicle.plateNumber}</p>
                    <p><strong>Type:</strong> {selectedUser.vehicle.type}</p>
                    <p><strong>Make:</strong> {selectedUser.vehicle.make}</p>
                    <p><strong>Model:</strong> {selectedUser.vehicle.model}</p>
                    <p><strong>Year:</strong> {selectedUser.vehicle.year}</p>
                  </>
                ) : (
                  <p>No vehicle information available.</p>
                )}
              </div>
              <div className="modal-footer">
                <button
                  type="button"
                  className="btn btn-secondary"
                  onClick={() => setShowDetails(false)}
                >
                  Close
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Users;
